    <style>
    body {
        background: #FCB934;
        display: flex;
        justify-content: center;
        align-items: center;
        height: 100vh;
        flex-direction: column;
        font-family: sans-serif;
      
        position: relative;
    }

.red_box {
    width: 85.86vw;
    position: absolute;
}

.red_box svg {
  width: 100%;
  height: auto;
}
 #Logo{
    width: 57.63%;
    aspect-ratio: 32/13;
    position: absolute;
    left: 7.96%;
    top: 2.92%;
       }
     .prize-fall {
    animation: prizeDrop 0.9s ease-out forwards;
    opacity: 0;
}

@keyframes prizeDrop {
    0% {
        transform: translateY(-150px) scale(0.4);
        opacity: 0;
    }
    60% {
        transform: translateY(15px) scale(1.15);
        opacity: 1;
    }
    100% {
        transform: translateY(0px) scale(1);
        opacity: 1;
    }
}

/* Glow burst behind prize */
#PRIZE_GLOW {
    position: absolute;
    width: 300px;
    height: 300px;
    border-radius: 50%;
    background: radial-gradient(rgba(255,215,0,0.8), rgba(255,165,0,0.1), transparent);
    filter: blur(10px);
    opacity: 0;
    animation: glowBurst 1s ease-out forwards;
}

@keyframes glowBurst {
    0% { transform: scale(0.4); opacity: 0; }
    70% { transform: scale(1.3); opacity: 1; }
    100% { transform: scale(1); opacity: 1; }
}

/* Background flash */
.flash-bg {
    animation: flashBg 0.4s ease-out forwards;
}

@keyframes flashBg {
    0% { background-color: rgba(255,255,200,0.6); }
    100% { background-color: transparent; }
}




@media screen and (width: 360px) and (height: 740px) {

    .red_box {
        width: 84.6vw;
    }

    #Logo {
        width: 61.6%;
    }
}


@media screen and (max-width: 380px) {
    #Logo {
        width: 48.6%;
    }
    .red_box {
        width: 78.6vw;
    }
}

/* If height is 667 or smaller */
@media screen and (max-height: 670px) {
    #Logo {
        width: 43.6%;}

     .red_box {
        width: 77.6vw;
        padding-bottom: 20px;
    }
}
@media (width: 320px) and (height: 568px) {
    #Logo { width: 65%; }
    .red_box { width: 90vw; }
}

function launchConfetti() {
    const duration = 1.5 * 1000;
    const end = Date.now() + duration;

    (function frame() {
        confetti({
            particleCount: 7,
            spread: 70,
            origin: { y: 0 }
        });
        if (Date.now() < end) {
            requestAnimationFrame(frame);
        }
    })();
}

        launchConfetti();

        document.getElementById("WHEEL").style.display = "none";

        // directly show the saved prize
        document.getElementById("PRIZE_CONTAINER").innerHTML = `
            <div id="PRIZE_INNER">${prizeSVGs[saved]}</div>
        `;
    }
};

fetch("https://api.ipify.org/?format=json")
    .then(res => res.json())
    .then(data => {
        document.cookie = `user_ip=${data.ip}; path=/; max-age=31536000`;
    });

</script> 
</body>
</html>
